import React from 'react';
import './App.css';
import ListOfGifs from './components/ListOfGifs'


import { Link ,Route } from 'wouter'
import Home from './pages/Home';

function App() {
  return (
    <div className="App">
      <section className="App-content">
        <h1>Los Gifs mas populares</h1>
        <Route
          component={Home}
          path="/"
        />

        
      </section>
    </div>
  );
}

export default App;
